import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from "react-router-dom";

import PrivateRoute from '../../utils/PrivateRoute';

import MusicCollection from '../MusicCollection/MusicCollection';
import RegistrationForm from '../Dialogs/RegistrationForm';
import LoginForm from '../Dialogs/LoginForm';
import UserNavBar from './UserNavBar';

class UserMenu extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            playlistCollection: [],
            isLoggedIn: false,
        }
        this.handleCallback = this.handleCallback.bind(this);
    }

    handleCallback(){
       // this.setState({isLoggedIn: true});
    }

    render() {
        console.log('here')
        return (
            <Router>
                <div>
                <UserNavBar isLoggedIn = {this.state.isLoggedIn} parentCallback = {this.handleCallback()} />
                    <Switch>
                        <Route path="/register">
                            <RegistrationForm />
                        </Route>
                        <Route path="/login">
                            <LoginForm />
                        </Route>
                        <PrivateRoute path="/">
                            <MusicCollection playlistCollection={this.state.playlistCollection}></MusicCollection>
                        </PrivateRoute>
                    </Switch>
                </div>
            </Router>
        );
    }
}

export default UserMenu;
